import React from 'react';

const EmployeeTable = () => {
  // Sample data
  const employees = [
    {
      name: 'John Doe',
      base: 50000,
      hra: 10000,
      conveyance: 2000,
      attendance: 95,
      netPayable: 62000,
      ctc: 70000
    },
    {
      name: 'Jane Smith',
      base: 55000,
      hra: 11000,
      conveyance: 2200,
      attendance: 98,
      netPayable: 68200,
      ctc: 77000
    },
    // Add more sample data as needed
  ];

  return (
    <div>
      <h1>Employee Table</h1>
      <table border="1">
        <thead>
          <tr>
            <th>Name</th>
            <th>Base</th>
            <th>HRA</th>
            <th>Conveyance</th>
            <th>Attendance</th>
            <th>Net Payable</th>
            <th>CTC</th>
          </tr>
        </thead>
        <tbody>
          {employees.map((employee, index) => (
            <tr key={index}>
              <td>{employee.name}</td>
              <td>{employee.base}</td>
              <td>{employee.hra}</td>
              <td>{employee.conveyance}</td>
              <td>{employee.attendance}</td>
              <td>{employee.netPayable}</td>
              <td>{employee.ctc}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default EmployeeTable;
